import React from 'react';
import podcastImage from '../assets/podcast.png';
const About = () => {
    const slides = [
        {
            image: podcastImage1,
            title: "AITU Podcast 1",
            description: "Университетский проект студентов, направленный на медиа развитие университета в сфере подкастинга и YouTube контент-мейкинга",
            link: "https://www.instagram.com/mediastudio.kz?igsh=c2VmNGgwOTIzeWx2"
        },
        {
            image: podcastImage2,
            title: "AITU Podcast 2",
            description: "Университетский проект студентов, направленный на медиа развитие университета в сфере подкастинга и YouTube контент-мейкинга",
            link: "https://www.instagram.com/mediastudio.kz?igsh=c2VmNGgwOTIzeWx2"
        }
    ];

    const [currentSlide, setCurrentSlide] = useState(0);

    const nextSlide = () => {
        setCurrentSlide((prevSlide) => (prevSlide + 1) % slides.length);
    };

    const prevSlide = () => {
        setCurrentSlide((prevSlide) => (prevSlide - 1 + slides.length) % slides.length);
    };



    return (
        <div>
        <section className="about" id='about'>
            <div>
                <h2>О НАС</h2>
                <div className="header_text2">
                    Мы предлагаем высококачественные оборудования, помощь профессионалов и разные локации для вашего удобства! Качественная акустика, кондиционер, чистота студии и приятное освещение сделает ваш опыт в нашей студии самым приятным и продуктивным!
                </div>
                <div className="header_text3">
                    Забронируйте время для съемок прямо сейчас!
                </div>
            </div>
            <div className="stats">
                <div className="stat">
                    <p className="number">№1</p>
                    <p className="stat_text">СТУДИЯ В КАЗАХСТАНЕ</p>
                </div>
                <div className="line1"></div>
                <div className="stat">
                    <p className="number">400+</p>
                    <p className="stat_text">ОБСЛУЖЕННЫХ КЛИЕНТОВ</p>
                </div>
                <div className="line1"></div>
                <div className="stat">
                    <p className="number">27</p>
                    <p className="stat_text">ПРОЕКТОВ</p>
                </div>
            </div>

        </section>
        <section className="project-zone" id='locations'>
        <div className="carousel-project">
                <img src={slides[currentSlide].image} alt={slides[currentSlide].title} className="carousel-image" />
                <div className="carousel-controls">
                    <button className="prev" onClick={prevSlide}>&#10094;</button>
                    <button className="next" onClick={nextSlide}>&#10095;</button>
                </div>
                <div className="carousel-caption-project">
                    <div className="caption-text">
                        <h3>{slides[currentSlide].title}</h3>
                        <p>{slides[currentSlide].description}</p>
                    </div>
                    <a href={slides[currentSlide].link} className="project-book">Смотреть</a>
                </div>

            </div>
        </section>
        </div>
    );
};

export default About;
